css:
.markdown-preview {
  background-color: #EEE;
  padding: 10px;
}
.editor-colors {
  background-color: #22313f;
  color: #1bbc9b;
}
.editor {
  background-color: #22313f;
  color: #1bbc9b;
}
.editor .wrap-guide {
  background-color: #65c6bb;
}
.editor .indent-guide {
  color: #36d7b7;
}
.editor .invisible-character {
  color: #36d7b7;
}
.editor .gutter {
  background-color: #344b60;
  color: #1ba39c;
  margin-right: 0.216em;
}
.editor .gutter .line-number.cursor-line {
  background-color: #336e7b;
  color: #1ba39c;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #1ba39c;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #336e7b;
}
.editor .invisible {
  color: #336e7b;
}
.editor .cursor {
  color: #336e7b;
}
.editor .selection .region {
  background-color: #344b60;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #66cc99;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #66cc99;
}
.comment {
  color: #22524a;
}
.entity.name.type {
  color: #65c6bb;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #65c6bb;
}
.keyword {
  color: #1ba39c;
}
.keyword.control {
  color: #1ba39c;
}
.keyword.operator {
  color: #95a5a6;
}
.keyword.other.special-method {
  color: #36d7b7;
}
.keyword.other.unit {
  color: #66cc99;
}
.storage {
  color: #95a5a6;
}
.constant {
  color: #1ba39c;
}
.constant.character.escape {
  color: #36d7b7;
}
.constant.numeric {
  color: #66cc99;
}
.constant.other.color {
  color: #22313f;
}
.constant.other.symbol {
  color: #65c6bb;
}
.variable {
  color: #65c6bb;
}
.variable.interpolation {
  color: #43b5a8;
}
.variable.parameter.function {
  color: #66cc99;
}
.invalid.illegal {
  background-color: #65c6bb;
  color: #66cc99;
}
.string {
  color: #1bbc9b;
  font-style: italic;
}
.string.regexp {
  color: #344b60;
}
.string.regexp .source.ruby.embedded {
  color: #1ba39c;
}
.string.other.link {
  color: #95a5a6;
}
.punctuation.definition.comment {
  color: #22524a;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #1bbc9b;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #1ba39c;
}
.punctuation.definition.bold {
  color: #1ba39c;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #36d7b7;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #798d8f;
}
.support.class {
  color: #95a5a6;
}
.support.function {
  color: #ccd4d5;
}
.support.function.any-method {
  color: #95a5a6;
}
.entity.name.function {
  color: #95a5a6;
}
.entity.name.class,
.entity.name.type.class {
  color: #95a5a6;
}
.entity.name.section {
  color: #95a5a6;
}
.entity.name.tag {
  color: #95a5a6;
  padding: 0px 2px;
}
.entity.other.attribute-name {
  color: #95a5a6;
}
.entity.other.attribute-name.id {
  color: #95a5a6;
}
.meta.class {
  color: #65c6bb;
}
.meta.link {
  color: #1ba39c;
}
.meta.require {
  color: #65c6bb;
}
.meta.selector {
  color: #65c6bb;
}
.meta.separator {
  background-color: #95a5a6;
  color: #65c6bb;
}
.none {
  color: #95a5a6;
}
.markup.bold {
  color: #65c6bb;
  font-style: bold;
}
.markup.changed {
  color: #1bbc9b;
}
.markup.deleted {
  color: #1ba39c;
}
.markup.italic {
  color: #66cc99;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #36d7b7;
}
.markup.inserted {
  color: #65c6bb;
}
.markup.list {
  color: #1bbc9b;
}
.markup.quote {
  color: #1ba39c;
}
.markup.raw.inline {
  color: #66cc99;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #95a5a6;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
